selector_to_html = {"a[href=\"wired.html#usb-hid-multi-key-send-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Set Di Invio Multi-Chiave Usb Hid<a class=\"headerlink\" href=\"#usb-hid-multi-key-send-set\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Bluetooth<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Domanda 4: Lo scanner beep cinque volte quando viene premuto un pulsante. Come posso risolvere questo problema?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong> La batteria \u00e8 scarica e deve essere ricaricata prima di poter essere nuovamente utilizzata.</p>", "a[href=\"scanmode.html#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Stesso Ritardo Del Codice<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>Per evitare che lo stesso codice a barre venga scansionato pi\u00f9 volte in <a class=\"reference internal\" href=\"#continuous-mode\">Modalit\u00e0 Continua</a> e <a class=\"reference internal\" href=\"#auto-sensing-mode\">Modalit\u00e0 di rilevamento automatico</a>, \u00e8 possibile richiedere allo scanner di attendere un ritardo impostato prima di consentire la scansione dello stesso codice a barre.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lingua Della Tastiera<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Ottieni Lingua Della Tastiera Attuale<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tempo Di Sospensione<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Scansionando il seguente codice impostazione, \u00e8 possibile impostare lo scanner per entrare in modalit\u00e0 sospensione dopo un certo periodo di tempo quando non viene scansionato alcun codice, in modo da ridurre il consumo energetico.</p>", "a[href=\"barcode.html#interleaved-2-of-5-itf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interfogliato 2 di 5/ITF<a class=\"headerlink\" href=\"#interleaved-2-of-5-itf\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id43\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#pdf417\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">PDF417<a class=\"headerlink\" href=\"#pdf417\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id80\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#digital-barcode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice A Barre Digitale<a class=\"headerlink\" href=\"#digital-barcode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-32\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 32<a class=\"headerlink\" href=\"#code-32\" title=\"Link to this heading\">#</a></h2><h3>Converti Codice 39 Al Codice 32 (Codice Farmaceutico Italiano)<a class=\"headerlink\" href=\"#convert-code-39-to-code-32-italian-pharmaceutical-code\" title=\"Link to this heading\">#</a></h3><p>Il codice 32 \u00e8 una variazione del codice 39 utilizzato dall\u2019industria farmaceutica italiana. Scansiona il codice a barre appropriato qui sotto per abilitare o disabilitare la conversione del codice 39 al codice 32.</p>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Di Sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie 2D<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#isbt-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISBT 128<a class=\"headerlink\" href=\"#isbt-128\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trasmetti Carattere ID Codice<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Un carattere ID codice identifica il tipo di codice di un codice a barre scansionato. Questo pu\u00f2 essere utile quando si decodifica pi\u00f9 di un tipo di codice. Il carattere ID codice \u00e8 inserito tra il carattere prefisso (se selezionato) e il simbolo decodificato.</p>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modifica Dati<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Formato Di Output<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Per modificare il formato di trasmissione dati di ricerca, scansiona uno degli otto codici a barre corrispondenti al formato desiderato.</p>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Abbinamento Uno-Unico<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configurazione Rapida<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Prefisso<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id67\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informazioni Batteria<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Scansione<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Dei Caratteri Finali<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Il carattere finale viene aggiunto dopo i dati decodificati nel formato dei dati decodificati + carattere finale.</p>", "a[href=\"barcode.html#aztec-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aztec Code<a class=\"headerlink\" href=\"#aztec-code\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id87\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#standdard-25-iata-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standdard 25/IATA 25<a class=\"headerlink\" href=\"#standdard-25-iata-25\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id61\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#qr-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">QR Code<a class=\"headerlink\" href=\"#qr-code\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id81\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Media<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id37\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id33\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Sensibilit\u00e0 Automatica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Nella modalit\u00e0 di rilevamento automatico, lo scanner rileva la luminosit\u00e0 dell\u2019ambiente circostante. Quando la luminosit\u00e0 cambia, la scansione viene attivata. La scansione termina quando la scansione ha successo o il tempo di scansione supera il tempo di lavoro singolo. Indipendentemente dal fatto che l\u2019ultima scansione abbia avuto successo o fallito, la luminosit\u00e0 dell\u2019ambiente circostante verr\u00e0 nuovamente rilevata.</p>", "a[href=\"wired.html#usb-keyboard-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Tastiera Usb<a class=\"headerlink\" href=\"#usb-keyboard-speed\" title=\"Link to this heading\">#</a></h2><h3>Ottieni Velocit\u00e0 Tastiera<a class=\"headerlink\" href=\"#get-keyboard-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Tastiera<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Impostazioni Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminatore<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>Impostazioni Dei Caratteri Finali<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Il carattere finale viene aggiunto dopo i dati decodificati nel formato dei dati decodificati + carattere finale.</p>", "a[href=\"barcode.html#nec-25-coop25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">NEC-25(COOP25)<a class=\"headerlink\" href=\"#nec-25-coop25\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id91\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie 1D<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bassa Velocit\u00e0<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#composite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">COMPOSIZIONE<a class=\"headerlink\" href=\"#composite\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id98\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Suffisso<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#d-reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Simbologie Inversa<a class=\"headerlink\" href=\"#d-reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id20\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-128-ucc-ean-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1-128 (UCC/EAN-128)<a class=\"headerlink\" href=\"#gs1-128-ucc-ean-128\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appendice<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>Codici A Barra Numerici<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-rss\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">DataBar GS1<a class=\"headerlink\" href=\"#gs1-databar-rss\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id79\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scansiona il codice di impostazione corrispondente per attivare/disattivare il prompt del suono dello scanner</p>", "a[href=\"barcode.html#brazil-bank-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice Banca Del Brasile<a class=\"headerlink\" href=\"#brazil-bank-code\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#data-matrix-dm\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrice Di Dati (Dm)<a class=\"headerlink\" href=\"#data-matrix-dm\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id83\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Domanda 1: La scansione \u00e8 riuscita, il buzzer suona una volta, ma non vengono caricati dati?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong> Lo scanner \u00e8 entrato in modalit\u00e0 di archiviazione e deve eseguire la scansione <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modalit\u00e0 normale</span></a> per recuperare.</p>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Wireless<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Questa modalit\u00e0 utilizza il 2. banda di frequenza GHz per la trasmissione di dati e si basa sulla tecnologia di radiofrequenza (RF), che si collega al computer tramite un ricevitore USB e consente allo scanner di muoversi liberamente entro una certa distanza.</p>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefisso<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Prefisso<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Nascondi Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Nascondi Barcode Start Chars<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html#transmission-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Trasmissione<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cavo USB come tastiera<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Domanda 1: La scansione \u00e8 riuscita, il buzzer suona una volta, ma non vengono caricati dati?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong> Lo scanner \u00e8 entrato in modalit\u00e0 di archiviazione e deve eseguire la scansione <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modalit\u00e0 normale</span></a> per recuperare.</p>", "a[href=\"barcode.html#discrete-2-of-5-industrial-2-of-5-ind25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Discreto 2 di 5/Industrial 2 di 5/IND25<a class=\"headerlink\" href=\"#discrete-2-of-5-industrial-2-of-5-ind25\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id49\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Tutte Le Simbologie<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#maxi-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Maxi Code<a class=\"headerlink\" href=\"#maxi-code\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id86\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrice 25<a class=\"headerlink\" href=\"#matrix-25\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id55\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#bookland-ean-isbn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bookland EAN(ISBN)<a class=\"headerlink\" href=\"#bookland-ean-isbn\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Domanda 2: Lo scanner scansiona con successo, beep due volte, e pu\u00f2 caricare i dati normalmente. Cosa sta succedendo?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong> La batteria della pistola dello scanner \u00e8 bassa e richiede che sia ricaricata.</p>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato Di Output<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Per modificare il formato di trasmissione dati di ricerca, scansiona uno degli otto codici a barre corrispondenti al formato desiderato.</p>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Domanda 3: Lo scanner scansiona con successo, beeps tre volte e non riesce a caricare i dati. Come posso risolvere questo problema?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong></p>", "a[href=\"wired.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Cablata<a class=\"headerlink\" href=\"#wired-mode\" title=\"Link to this heading\">#</a></h1><h2>Modalit\u00e0 Di Trasmissione<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cavo USB come tastiera<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Di Trasmissione Tastiera Ricevitore<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tutte Le Simbologie<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Archiviazione<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Caricamento Dati<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#nt-1950-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guida Di Configurazione Rapida <strong>NT-1950</strong> Wireless Scanner<a class=\"headerlink\" href=\"#nt-1950-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Blocca Codici A Barre Con Url<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Blocca la scansione dei codici QR URL a partire da <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"barcode.html#han-xin-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Han Xin COde<a class=\"headerlink\" href=\"#han-xin-code\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id88\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#msi-msi-plessey\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI/MSI Plessey<a class=\"headerlink\" href=\"#msi-msi-plessey\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id73\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Continua<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Lo scanner funziona in modo continuo. Se la scansione \u00e8 riuscita o il tempo di scansione supera il tempo di lavoro singolo, la scansione corrente termina. Se il tempo supera il tempo specificato, la scansione successiva viene attivata automaticamente.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ottieni Versione Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#issn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EMISSN<a class=\"headerlink\" href=\"#issn\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id90\" title=\"Link to this heading\">#</a></h3><p>Converti in EAN13 quando disabilitato</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Domanda 5: Scansione dei dati caricati non corretta?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Risposta:</strong></p>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Lavoro<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Nella zona di lavoro al di fuori della gamma di 2. Ricevitore G o segnale Bluetooth, \u00e8 possibile attivare la modalit\u00e0 di archiviazione dello scanner seguendo i passaggi descritti di seguito. In questa modalit\u00e0, tutti i dati scansionati saranno memorizzati direttamente nello scanner. Prima di caricare i dati, verr\u00e0 salvato in modo permanente nello scanner in modo da poter caricare i dati quando lo scanner \u00e8 nell\u2019intervallo di segnale di ricezione.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Normale<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#automatic-selection-of-wired-wireless-transmission\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Selezione Automatica Di Trasmissione Wired/Wireless<a class=\"headerlink\" href=\"#automatic-selection-of-wired-wireless-transmission\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta Velocit\u00e0<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
